import React from "react";

export default function Goods(props) {
  const { id, name, description, image,full_background,price} = props;
  return (
    <>
      <div className=" cards col s12 m4 l3">
        <div className="card" id={id}>
          <div
            className="card-image "
            style={{ width: "100%", height: "300px" }}
          >
            <img
              style={{
                width: `calc(100%)`,
                height: "100%",
                padding: "0",
                boxSizing: "border-box",
              }}
              src={
                image ? image : "https://media.fortniteapi.io/images/displayAssets/v2/CID_A_195_M_Crisis.png"
              }
              alt="shop"
            />
            <a
              href="#!"
              className="btn-floating halfway-fab waves-effect waves-light red"
            >
              <i className="material-icons">add</i>
            </a>
          </div>
          <div className="card-content">
            <span>{name}</span>
            <p>
             {description}
            </p>
          </div>
          <div className="card-action d-flex justify-content-between">
              <span>{price}</span>
              <button className="btn blue darken-4">buy</button>
          </div>  
        </div>
      </div>
    </>
  );
}
